   position:fixed;
   margin-top:53px;
   height:40px;
   width:100%;
   border-top:1px solid var(--color-border-top);
   display:flex;
   padding:0 5px;


  >ul {
    display:flex;
    justify-content:center;
    align-items:center;
    padding: 8px 16px;

    >li {
      display:flex;
      justify-content:center;
      align-items:center;


    }


